import React from "react";
import image01 from "../image/aboutmeKevin.jpg";

class AboutMe extends React.Component {
  render() {
    return (
      <div className="aboutMeContainer">
        <div className="aboutMe">
          <div className="col-left">
            <img src={image01} alt="kevin-kim" />
          </div>

          <div className="col-right">
            <h1>About Me</h1>
            <p>
              I have experience building full stack applications with React,
              ASP.NET for server development, and SQL Server for database
              design. I have worked in an agile/SCRUM environment where I
              participated in daily stand-up and frequent code review. I am also
              familiar in building applications with other Javascript libraries
              such as JQuery or even vanilla Javascript. I pride myself on
              having good fundamentals in writing scalable, modularized, and
              efficient code, always looking for new ways to further my
              knowledge. Having worked in a team of 15, I thrive well in team
              settings and am able to adapt and learn quickly.
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default AboutMe;
